import { SendScript } from "../SendScript";
import React, { useEffect } from 'react';


function UploadButton() {

    const script = "Never gonna give you up"; //temp

    // function to call SendScript
    useEffect(() => {
        SendScript(script);
    }
    );


    return (
        <div>
            <button onClick={(e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => SendScript(script)}
                disabled={script === null}>
                Upload Script
            </button>
        </div>
    );
}

export default UploadButton;
